import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function WelcomeScreen() {
  const navigate = useNavigate();

  return (
    <div className="relative min-h-screen w-full flex flex-col justify-between items-center bg-[var(--color-bg-gloss-black)] text-[var(--color-gloss-white)] font-sans overflow-hidden">
      {/* Animated Energy Background */}
      <div className="animated-bg-energy" />

      {/* Top Bar */}
      <div className="w-full flex justify-between items-start px-8 pt-8 text-base font-medium text-[var(--color-cool-gray)] z-10">
        <span>Careers (2)</span>
        <span>Get in touch</span>
      </div>

      {/* Centered Hero Content */}
      <div className="hero-ares w-full flex-1 flex flex-col items-center justify-center z-10" style={{maxWidth: 1100, margin: '0 auto'}}>
        <div className="text-center select-none w-full" style={{maxWidth: 900}}>
          <div className="ares-logo mb-[60px]">ARES</div>
          <div className="ares-title mb-[60px]">TRADING EXCHANGE</div>
          <div className="ares-tagline mb-[60px]">MEME COIN DEFI EXCHANGE</div>
          <button
            className="btn-ares mt-2"
            onClick={() => navigate('/feed')}
          >
            ENTER
          </button>
        </div>
      </div>

      {/* Bottom Center */}
      <div className="w-full flex justify-center items-end pb-8 text-[var(--color-cool-gray)] text-base font-medium z-10">
        <span>Our Products</span>
      </div>
    </div>
  );
}
